import React from "react";
import Sidebar from './Sidebar';
import Bar from './Bar';

const Galery = () => {
  return (
    <div>
      <div className="contenedor-app">
        <Sidebar />
        <div className="seccion-principal">
          <Bar />
          <h1>Select an Album</h1>
        </div>
      </div>
    </div>
  );
};

export default Galery;
